import { SIZES } from "../../constants";

export enum HeadingTypes {
  h1 = "h1",
  h2 = "h2",
  h3 = "h3",
  h4 = "h4",
  h5 = "h5",
  h6 = "h6"
}

export const HeadingSizes = SIZES;
